import React from "react";
import { FunctionComponent, SVGProps } from "react";

/**
 * ChevronDown Icon
 * @param className
 * @returns ChevronDownIcon
 */
export const ChevronDownIcon: FunctionComponent<SVGProps<SVGSVGElement>> = (
  props,
) => {
  return (
    <svg
      width="20"
      height="20"
      viewBox="0 0 20 20"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      <g id="Icon/chevron-down">
        <path
          id="Vector 146"
          d="M5 8L10 13L15 8"
          stroke="currentColor"
          strokeWidth="1.5"
          strokeLinecap="round"
          strokeLinejoin="round"
        />
      </g>
    </svg>
  );
};
